atePipe  -->\n\nL10nTranslationModule->L10nTranslatePipe \n\n\n\n\n\nL10nValidateDateDirective\n\nL10nValidateDateDirective\n\n\n\nL10nValidationModule\n\nL10nValidationModule\n\nL10nValidationModule -->\n\nL10nValidateDateDirective->L10nValidationModule\n\n\n\n\n\nL10nValidateNumberDirective\n\nL10nValidateNumberDirective\n\nL10nValidationModule -->\n\nL10nValidateNumberDirective->L10nValidationModule\n\n\n\n\n\nL10nValidateDateDirective \n\nL10nValidateDateDirective \n\nL10nValidateDateDirective  -->\n\nL10nValidationModule->L10nValidateDateDirective \n\n\n\n\n\nL10nValidateNumberDirective \n\nL10nValidateNumberDirective \n\nL10nValidateNumberDirective  -->\n\nL10nValidationModule->L10nValidateNumberDirective \n\n\n\n L10nValidateDateDirective), multi: true } -->\n\n{ provide: NG_VALIDATORS, useExisting: forwardRef(() => L10nValidateDateDirective), multi: true }\n\n{ provide: NG_VALIDATORS, useExisting: forwardRef(() => L10nValidateDateDirective), multi: true }\n\n L10nValidateDateDirective), multi: true }->L10nValidateDateDirective -->\n\n{ provide: NG_VALIDATORS, useExisting: forwardRef(() => L10nValidateDateDirective), multi: true }->L10nValidateDateDirective\n\n\n\n L10nValidateNumberDirective), multi: true } -->\n\n{ provide: NG_VALIDATORS, useExisting: forwardRef(() => L10nValidateNumberDirective), multi: true }\n\n{ provide: NG_VALIDATORS, useExisting: forwardRef(() => L10nValidateNumberDirective), multi: true }\n\n L10nValidateNumberDirective), multi: true }->L10nValidateNumberDirective -->\n\n{ provide: NG_VALIDATORS, useExisting: forwardRef(() => L10nValidateNumberDirective), multi: true }->L10nValidateNumberDirective\n\n\n\n\n\n\n    \n    \n    \n        Zoom in\n        Reset\n        Zoom out\n    \n\n  \n\n    \n        \n            \n                \n                    \n                    \n                        4 Modules\n                    \n                \n            \n        \n        \n            \n                \n              